import { Col, Form } from "react-bootstrap";
export const FormInputLabel = (props) => {
  return (
    <Col md={props.size}>
      {/* <Form.Group>
        <Form.Label>{props.label}</Form.Label>
        <Form.Control
          type={props.type}
          readOnly={props.readOnly}
          onChange={props.change}
